export const Icon = (props) => {
  let { icon } = props;
  if (!icon) icon = "default";
  switch (icon) {
    case "javascript":
      return <JavaScriptIcon color="#F0DB4F" />;
    case "react":
      return <ReactIcon color="#00ffff" />;
    case "laravel":
      return <LaravelIcon color="#FF2D20" />;
    case "nodejs":
      return <NodeIcon color="#4A90E2" />;
    default:
      return <DefaultIcon color="#ffffff" />;
  }
};
